        <Navbar />
        <Switch>
          <Route path="/" exact component={Home} />
          <Route path="/" exact component={Home} />
          <Route path="/" exact component={Home} />
          <Route path="/" exact component={Home} />

        </Switch>
      </Router>
    </>
  );
}

export default App;
